from typing import List


class Solution:
    def twoSum(self, numbers: List[int], target: int) -> List[int]:
        returnArray = []
        prevValue = numbers[-1]
        for i in range(len(numbers)):
            if numbers[i] == prevValue:
                continue
            j = len(numbers) - 1
            while j != i:
                if numbers[j] + numbers[i] == target:
                    returnArray.append(i + 1)
                    returnArray.append(j + 1)
                    return returnArray
                j -= 1
            prevValue = numbers[i]
    

